import React from 'react';
import { Outlet, useParams, useNavigate } from 'react-router-dom';

export default function FormBase() {
  return (
    <FormBaseComponent params={useParams()} navigate={useNavigate()} />
  );
}

class FormBaseComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      page: this.props.params.page,
      form: this.props.params.form,
    };
  }

  render() {
    return (
      <>
        <br />
        <div className='form-group'>
          <button className='btn btn-primary' onClick={this.handleBackButton}>Back</button>
        </div>

        <form onSubmit={this.handleSubmit}>
          <Outlet />

          <div className='form-group'>
            <button className='btn btn-success' type='submit'>Continue</button>
          </div>
        </form>
      </>
    );
  }
}
